Bad Code Suppose the current log level is INFO and there is a DEBUG log that logs a value returned from a function with heavy computations. Since DEBUG level logs are not printed due to log level; ideally, the function with heavy computations should not be executed. But in the below code, still, the getDuration function is executed even though the debug log line is printed. import ballerina/log;
import ballerina/random; public function main() { float duration = getDutration(); log:printDebug("Checking the duration", duration = duration);
} function getDutration() returns float { log:printInfo("Calculating duration"); return random:createDecimal() * 100.0;
} Good Code Can avoid this by passing a pointer to the function as a value in a key/value pair like follows. import ballerina/log;
import ballerina/random; public function main() { log:printDebug("Checking the duration", duration = isolated function() returns float { log:printInfo("Calculating duration optimally"); return random:createDecimal() * 100.0;});
}

